('NA000101', 'Quercinus', 'masculine', TRUE, FALSE, 'Latin adjective derived from *quercus* "oak". Rare name possibly indicating connection to oak groves or Jupiter Quercinus.', 'Quercinus', 'Quercinus', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000102', 'Sciurinus', 'masculine', TRUE, FALSE, 'Roman cognomen derived from Greek *skiouros* (*σκίουρος*) "squirrel", literally "shadow-tail". Rare name possibly indicating agility or a nickname based on physical characteristics.', 'Sciurinus', 'Sciurinus', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000103', 'Sciurius', 'masculine', TRUE, FALSE, 'Roman cognomen derived from Greek *skiouros* (*σκίουρος*) "squirrel", literally "shadow-tail". Variant form, possibly indicating agility or behavior reminiscent of a squirrel.', 'Sciurius', 'Sciurius', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000104', 'Macrobius', 'masculine', TRUE, FALSE, 'Latin name derived from Greek *makrobios* (*μακροβίος*) "long-lived". Famous bearer: Macrobius Ambrosius Theodosius, late Roman writer.', 'Macrobius', 'Macrobius', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000105', 'Virgil', 'masculine', TRUE, FALSE, 'Anglicized form of *Vergilius*. Famous bearer: Publius Vergilius Maro (Virgil), author of the *Aeneid*. Name possibly derived from *virga* "rod", "staff".', 'Virgil', 'Virgil', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000106', 'Numa', 'masculine', TRUE, FALSE, 'Roman name of uncertain etymology, possibly Sabine. Famous bearer: Numa Pompilius, second legendary king of Rome, known for religious reforms and peaceful reign.', 'Numa', 'Numa', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000107', 'Suetonius', 'masculine', TRUE, FALSE, 'Roman nomen of uncertain origin. Famous bearer: Gaius Suetonius Tranquillus, Roman historian and author of *The Twelve Caesars*.', 'Suetonius', 'Suetonius', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000108', 'Varro', 'masculine', TRUE, FALSE, 'Roman cognomen meaning *varus* "knock-kneed" or "bow-legged". Famous bearer: Marcus Terentius Varro, scholar and author.', 'Varro', 'Varro', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000109', 'Tullus', 'masculine', TRUE, FALSE, 'Roman praenomen. Famous bearer: Tullus Hostilius, third legendary king of Rome, known for militaristic reign. Etymology uncertain.', 'Tullus', 'Tullus', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

-- Female Name
('NA000110', 'Silvia', 'feminine', TRUE, FALSE, 'Roman feminine name derived from *silva* "forest". Famous bearer: Rhea Silvia, mother of Romulus and Remus. Also spelled *Rea Silvia*.', 'Silvia', 'Silvia', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

-- Additional Cognomina
('NA000111', 'Mucius', 'masculine', TRUE, FALSE, 'Roman nomen/cognomen. Famous bearer: Gaius Mucius Scaevola. Etymology uncertain, possibly related to *muticus* "docked" or Etruscan origin.', 'Mucius', 'Mucius', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

-- Latin Name from Greek Origin
('NA000112', 'Ulysses', 'masculine', TRUE, FALSE, 'Latin form of Greek *Odysseus* (*Ὀδυσσεύς*). The Roman name for the Greek hero Odysseus, used throughout Latin literature. Etymology uncertain, possibly from Greek *odyssomai* "to be angry at".', 'Ulysses', 'Ulysses', 'SC00001', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP);

-- Greek Mythological Names
('NA000112', 'Amalthea', 'feminine', TRUE, FALSE, 'Greek mythological name meaning "tender goddess". Foster mother of Zeus, goat tender often depicted as a goat or as a goat-tending nymph. From Greek *amaltheia* (*ἀμάλθεια*), possibly from *amalthes* "tender" + *thea* "goddess".', 'Ἀμάλθεια', 'Amalthea', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000113', 'Aigaion', 'masculine', TRUE, FALSE, 'Greek mythological name meaning "goat mountain" or "of the goat". From Greek *aix* (*αἴξ*) "goat" + *-aion* suffix. Also known as Briareos, one of the Hecatoncheires (hundred-handed ones).', 'Αἰγαίων', 'Aigaion', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000114', 'Hyperion', 'masculine', TRUE, FALSE, 'Greek Titan name meaning "he who goes before" or "he who watches from above". From Greek *hyper* (*ὑπέρ*) "over, above" + *ion* (*ἰών*) "going". Titan of heavenly light, father of Helios (Sun), Selene (Moon), and Eos (Dawn).', 'Ὑπερίων', 'Hyperion', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000115', 'Theia', 'feminine', TRUE, FALSE, 'Greek Titaness name meaning "divine" or "goddess". From Greek *theia* (*θεία*), feminine form of *theios* (*θεῖος*) "divine, godly". Titaness of sight and the shining light of the clear blue sky, wife of Hyperion, mother of Helios, Selene, and Eos.', 'Θεία', 'Theia', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000116', 'Astraios', 'masculine', TRUE, FALSE, 'Greek Titan name meaning "of the stars" or "starry". From Greek *astraios* (*ἀστραῖος*), derived from *aster* (*ἀστήρ*) "star". Titan of dusk, the stars, planets, and the art of astrology. Father of the four winds and the stars.', 'Ἀστραῖος', 'Astraios', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000117', 'Circe', 'feminine', TRUE, FALSE, 'Greek goddess and enchantress name, possibly meaning "bird" or "hawk". From Greek *Kirke* (*Κίρκη*), possibly from *kirkos* (*κίρκος*) "hawk, falcon". Goddess of magic and witch who charms her victims before turning them into swine. Famous from Homer''s *Odyssey*, where she transforms Odysseus''s men into pigs.', 'Κίρκη', 'Circe', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000118', 'Calypso', 'feminine', TRUE, FALSE, 'Greek nymph name meaning "she who conceals" or "she who hides". From Greek *kalypto* (*καλύπτω*) "to cover, to conceal, to hide". Ancient sea nymph who detained Odysseus on her island Ogygia for seven years in Homer''s *Odyssey*.', 'Καλυψώ', 'Calypso', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000119', 'Pheidon', 'masculine', TRUE, FALSE, 'Greek name meaning "giver of life" or "sparing, frugal". From Greek *pheidomai* (*φείδομαι*) "to spare, to be sparing" or possibly from *phos* (*φῶς*) "light" + *didonai* (*δίδωμι*) "to give". Historical bearer: Pheidon of Argos, 7th century BCE king known for economic reforms.', 'Φείδων', 'Pheidon', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000120', 'Diodorus', 'masculine', TRUE, FALSE, 'Greek name meaning "gift of Zeus". From Greek *Dios* (*Διός*), genitive of *Zeus* (*Ζεύς*) + *doron* (*δῶρον*) "gift". Famous bearer: Diodorus Siculus, 1st century BCE Greek historian who wrote *Bibliotheca historica*.', 'Διόδωρος', 'Diodorus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

-- Greek Historical Names
('NA000121', 'Orthagoras', 'masculine', TRUE, FALSE, 'Greek name meaning "straight speaker" or "righteous in the assembly". From Greek *orthos* (*ὀρθός*) "straight, correct, right" + *agora* (*ἀγορά*) "assembly, marketplace". Historical bearer: Orthagoras of Sicyon, 7th century BCE tyrant who founded the Orthagorid dynasty.', 'Ὀρθαγόρας', 'Orthagoras', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000122', 'Teisander', 'masculine', TRUE, FALSE, 'Greek name meaning "he who stretches/extends order" or "avenger of men". From Greek *tisis* (*τίσις*) "vengeance, payment" or *teino* (*τείνω*) "to stretch" + *aner* (*ἀνήρ*), genitive *andros* (*ἀνδρός*) "man". Ancient Greek personal name.', 'Τείσανδρος', 'Teisander', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000123', 'Cleisthenes', 'masculine', TRUE, FALSE, 'Greek name meaning "famous for strength" or "glory and might". From Greek *kleos* (*κλέος*) "fame, glory" + *sthenos* (*σθένος*) "strength, might". Famous bearer: Cleisthenes of Athens (c. 570-508 BCE), reformer who established Athenian democracy.', 'Κλεισθένης', 'Cleisthenes', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000124', 'Hippocleides', 'masculine', TRUE, FALSE, 'Greek name meaning "son of famous horses" or "glory of horses". From Greek *hippos* (*ἵππος*) "horse" + *kleos* (*κλέος*) "fame, glory" + patronymic suffix *-ides*. Famous for saying "Hippocleides doesn''t care!" when he danced away his marriage to Agariste.', 'Ἱπποκλείδης', 'Hippocleides', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000125', 'Bacchiadae', 'masculine', TRUE, FALSE, 'Greek family name meaning "descendants of Bacchis" or "followers of Bacchus". From Greek *Bakkhios* (*Βάκχιος*) related to Bacchus/Dionysus + patronymic plural *-adae*. The Bacchiadae were an ancient Greek ruling family in Corinth (c. 747-657 BCE).', 'Βακχιάδαι', 'Bacchiadae', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000126', 'Periander', 'masculine', TRUE, FALSE, 'Greek name meaning "exceedingly manly" or "very masculine". From Greek *peri* (*περί*) "around, exceedingly" + *aner* (*ἀνήρ*), genitive *andros* (*ἀνδρός*) "man". Famous bearer: Periander of Corinth (c. 627-585 BCE), one of the Seven Sages of Greece and tyrant of Corinth.', 'Περίανδρος', 'Periander', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000127', 'Peisistratus', 'masculine', TRUE, FALSE, 'Greek name meaning "he who persuades the army" or "convincer of the host". From Greek *peitho* (*πείθω*) "to persuade, convince" + *stratos* (*στρατός*) "army, host". Famous bearer: Peisistratus of Athens (c. 600-527 BCE), tyrant who ruled Athens and patron of the arts.', 'Πεισίστρατος', 'Peisistratus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000128', 'Sthenelaidas', 'masculine', TRUE, FALSE, 'Greek Spartan name meaning "son of strength". From Greek *sthenos* (*σθένος*) "strength, might" + Spartan patronymic suffix. Historical bearer: Sthenelaidas, Spartan ephor in 432 BCE who advocated for war against Athens before the Peloponnesian War.', 'Σθενελαΐδας', 'Sthenelaidas', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000129', 'Cleostratus', 'masculine', TRUE, FALSE, 'Greek name meaning "famous army" or "glorious host". From Greek *kleos* (*κλέος*) "fame, glory" + *stratos* (*στρατός*) "army, host". Historical bearer: Cleostratus of Tenedos, 6th century BCE Greek astronomer who introduced the zodiac to Greek astronomy.', 'Κλεόστρατος', 'Cleostratus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000130', 'Peisiphilus', 'masculine', TRUE, FALSE, 'Greek name meaning "persuader of friends" or "he who wins friends by persuasion". From Greek *peitho* (*πείθω*) "to persuade, convince" + *philos* (*φίλος*) "friend, beloved". Ancient Greek personal name.', 'Πεισίφιλος', 'Peisiphilus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000131', 'Aristophanes', 'masculine', TRUE, FALSE, 'Greek name meaning "best appearing" or "noblest manifestation". From Greek *aristos* (*ἄριστος*) "best, noblest" + *phanes* (*φάνης*) "appearing, shining" from *phaino* (*φαίνω*) "to show, appear". Famous bearer: Aristophanes (c. 446-386 BCE), greatest comic playwright of ancient Greece.', 'Ἀριστοφάνης', 'Aristophanes', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000132', 'Nicander', 'masculine', TRUE, FALSE, 'Greek name meaning "victory of man" or "man''s victory". From Greek *nike* (*νίκη*) "victory" + *aner* (*ἀνήρ*), genitive *andros* (*ἀνδρός*) "man". Historical bearer: Nicander of Colophon, 2nd century BCE Greek poet and physician.', 'Νίκανδρος', 'Nicander', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000133', 'Nicomachus', 'masculine', TRUE, FALSE, 'Greek name meaning "victorious in battle" or "victory fighter". From Greek *nike* (*νίκη*) "victory" + *mache* (*μάχη*) "battle, fight". Famous bearer: Nicomachus, father of Aristotle and physician to King Amyntas III of Macedon; also Nicomachus of Gerasa, 2nd century CE mathematician.', 'Νικόμαχος', 'Nicomachus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000134', 'Philip', 'masculine', TRUE, FALSE, 'Greek name meaning "lover of horses" or "friend of horses". From Greek *philos* (*φίλος*) "loving, friend" + *hippos* (*ἵππος*) "horse". Famous bearer: Philip II of Macedon (382-336 BCE), father of Alexander the Great and unifier of Greece.', 'Φίλιππος', 'Philip', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

-- Greek Historical and Mythological Heroes
('NA000135', 'Alexander', 'masculine', TRUE, FALSE, 'Greek name meaning "defender of men" or "protector of mankind". From Greek *alexo* (*ἀλέξω*) "to defend, to help" + *aner* (*ἀνήρ*), genitive *andros* (*ἀνδρός*) "man". Famous bearer: Alexander the Great (356-323 BCE), king of Macedon who created one of the largest empires in history.', 'Ἀλέξανδρος', 'Alexander', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000136', 'Antigonus', 'masculine', TRUE, FALSE, 'Greek name meaning "against birth" or "in place of an ancestor". From Greek *anti* (*ἀντί*) "against, in place of" + *gonos* (*γόνος*) "birth, offspring". Famous bearers: Antigonus I Monophthalmus ("the One-Eyed"), one of Alexander''s successors (Diadochi).', 'Ἀντίγονος', 'Antigonus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000137', 'Aristotle', 'masculine', TRUE, FALSE, 'Greek name meaning "best purpose" or "excellent end/goal". From Greek *aristos* (*ἄριστος*) "best, noblest" + *telos* (*τέλος*) "end, purpose, goal". Famous bearer: Aristotle (384-322 BCE), philosopher and polymath, student of Plato and teacher of Alexander the Great.', 'Ἀριστοτέλης', 'Aristotle', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000138', 'Plato', 'masculine', TRUE, FALSE, 'Greek name meaning "broad" or "wide". From Greek *platos* (*πλάτος*) "breadth, width". Possibly a nickname referring to his broad shoulders or forehead. Famous bearer: Plato (c. 428-348 BCE), philosopher, student of Socrates, founder of the Academy.', 'Πλάτων', 'Plato', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000139', 'Democritus', 'masculine', TRUE, FALSE, 'Greek name meaning "chosen of the people" or "judged by the people". From Greek *demos* (*δῆμος*) "people" + *kritos* (*κριτός*) "chosen, judged". Famous bearer: Democritus (c. 460-370 BCE), pre-Socratic philosopher who developed atomic theory.', 'Δημόκριτος', 'Democritus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000140', 'Socrates', 'masculine', TRUE, FALSE, 'Greek name meaning "whole power" or "sound in strength". From Greek *sos* (*σῶς*) "safe, sound, whole" + *kratos* (*κράτος*) "power, strength". Famous bearer: Socrates (c. 470-399 BCE), classical Greek philosopher credited as founder of Western philosophy.', 'Σωκράτης', 'Socrates', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000141', 'Seleucus', 'masculine', TRUE, FALSE, 'Greek name of uncertain etymology, possibly meaning "white" or "bright". Possibly from Greek *leukos* (*λευκός*) "white, bright". Famous bearer: Seleucus I Nicator (c. 358-281 BCE), founder of the Seleucid Empire, one of Alexander''s successors.', 'Σέλευκος', 'Seleucus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000142', 'Ptolemy', 'masculine', TRUE, FALSE, 'Greek name meaning "warlike" or "aggressive". From Greek *ptolemos* (*πτόλεμος*), dialectal variant of *polemos* (*πόλεμος*) "war". Famous bearer: Ptolemy I Soter (367-282 BCE), founder of the Ptolemaic dynasty in Egypt; also Claudius Ptolemy, 2nd century astronomer.', 'Πτολεμαῖος', 'Ptolemy', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000143', 'Nicodemus', 'masculine', TRUE, FALSE, 'Greek name meaning "victory of the people". From Greek *nike* (*νίκη*) "victory" + *demos* (*δῆμος*) "people". Biblical bearer: Nicodemus, Pharisee and member of the Sanhedrin who visited Jesus at night (Gospel of John).', 'Νικόδημος', 'Nicodemus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000144', 'Plotinus', 'masculine', TRUE, FALSE, 'Greek name, Latinized form possibly meaning "of Plotios" or related to Greek *ploutos* (*πλοῦτος*) "wealth, riches". Famous bearer: Plotinus (c. 204-270 CE), founder of Neoplatonism, major influence on Christian, Jewish, and Islamic philosophy.', 'Πλωτῖνος', 'Plotinus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000145', 'Hector', 'masculine', TRUE, FALSE, 'Greek name meaning "holding fast" or "defender". From Greek *ekhein* (*ἔχειν*) "to hold, to possess". Famous bearer: Hector, Trojan prince and greatest warrior of Troy in Homer''s *Iliad*, son of King Priam and slain by Achilles.', 'Ἕκτωρ', 'Hector', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000146', 'Agamemnon', 'masculine', TRUE, FALSE, 'Greek name meaning "very resolute" or "very steadfast". From Greek *agan* (*ἄγαν*) "very, much" + *memnon* (*μέμνων*) "resolute, steadfast". King of Mycenae, commander of Greek forces in the Trojan War, brother of Menelaus.', 'Ἀγαμέμνων', 'Agamemnon', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000147', 'Menelaus', 'masculine', TRUE, FALSE, 'Greek name meaning "withstanding the people" or "strength of the people". From Greek *meno* (*μένω*) "to withstand, to remain" + *laos* (*λαός*) "people". King of Sparta, husband of Helen whose abduction by Paris sparked the Trojan War.', 'Μενέλαος', 'Menelaus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000148', 'Odysseus', 'masculine', TRUE, FALSE, 'Greek name possibly meaning "wrathful" or "hated". From Greek *odyssomai* (*ὀδύσσομαι*) "to be angry at, to hate". Hero of Homer''s *Odyssey*, king of Ithaca known for his cunning intelligence and ten-year journey home after the Trojan War.', 'Ὀδυσσεύς', 'Odysseus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000149', 'Priam', 'masculine', TRUE, FALSE, 'Greek name possibly meaning "ransomed" or "redeemed". From Greek *priamai* (*πρίαμαι*) "to buy, to ransom". King of Troy during the Trojan War, father of Hector and Paris, killed by Neoptolemus during the fall of Troy.', 'Πρίαμος', 'Priam', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000150', 'Paris', 'masculine', TRUE, FALSE, 'Greek name of uncertain origin, possibly pre-Greek. Also known as Alexander. Trojan prince whose abduction of Helen sparked the Trojan War. Slayer of Achilles with an arrow to the heel.', 'Πάρις', 'Paris', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000151', 'Aeneas', 'masculine', TRUE, FALSE, 'Greek name possibly meaning "praised" or "praiseworthy". From Greek *ainein* (*αἰνεῖν*) "to praise". Trojan hero, son of Anchises and Aphrodite, survivor of Troy who became legendary founder of Rome in Virgil''s *Aeneid*.', 'Αἰνείας', 'Aeneas', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000152', 'Pericles', 'masculine', TRUE, FALSE, 'Greek name meaning "surrounded by glory" or "encompassed by fame". From Greek *peri* (*περί*) "around" + *kleos* (*κλέος*) "glory, fame". Famous bearer: Pericles (c. 495-429 BCE), influential Athenian statesman during the Golden Age of Athens.', 'Περικλῆς', 'Pericles', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000153', 'Leonidas', 'masculine', TRUE, FALSE, 'Greek name meaning "lion-like" or "son of a lion". From Greek *leon* (*λέων*) "lion" + patronymic suffix *-idas*. Famous bearer: Leonidas I of Sparta (c. 540-480 BCE), king who led 300 Spartans at the Battle of Thermopylae.', 'Λεωνίδας', 'Leonidas', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000154', 'Solon', 'masculine', TRUE, FALSE, 'Greek name possibly meaning "wise" or related to Greek *sōlos* (*σῶλος*) "whole, safe". Famous bearer: Solon of Athens (c. 638-558 BCE), lawmaker and poet, one of the Seven Sages of Greece, credited with laying foundations for Athenian democracy.', 'Σόλων', 'Solon', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000155', 'Lycurgus', 'masculine', TRUE, FALSE, 'Greek name meaning "wolf-worker" or "he who works with wolves". From Greek *lykos* (*λύκος*) "wolf" + *ergon* (*ἔργον*) "work". Legendary lawgiver of Sparta who established the military-oriented reformation of Spartan society.', 'Λυκοῦργος', 'Lycurgus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000156', 'Helen', 'feminine', TRUE, FALSE, 'Greek name possibly meaning "torch" or "light". From Greek *helene* (*Ἑλένη*), possibly from *hele* (*ἑλη*) "torch" or related to *helios* (*ἥλιος*) "sun". Famous bearer: Helen of Troy, daughter of Zeus and Leda, considered the most beautiful woman in the world.', 'Ἑλένη', 'Helen', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000157', 'Demetrius', 'masculine', TRUE, FALSE, 'Greek name meaning "follower of Demeter" or "devoted to Demeter". From Greek *Demeter* (*Δημήτηρ*), goddess of harvest + devotional suffix. Famous bearers: Demetrius I Poliorcetes ("the Besieger"), several Seleucid and Macedonian kings.', 'Δημήτριος', 'Demetrius', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000158', 'Cassander', 'masculine', TRUE, FALSE, 'Greek name meaning "helper of men" or "brother''s helper". From Greek *kassis* (*κάσσις*) "brother" or *kasis* "helper" + *aner* (*ἀνήρ*), genitive *andros* (*ἀνδρός*) "man". Famous bearer: Cassander (c. 350-297 BCE), king of Macedon, one of Alexander''s successors.', 'Κάσσανδρος', 'Cassander', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000159', 'Lysander', 'masculine', TRUE, FALSE, 'Greek name meaning "liberator of men" or "freer of men". From Greek *lysis* (*λύσις*) "freeing, loosening" + *aner* (*ἀνήρ*), genitive *andros* (*ἀνδρός*) "man". Famous bearer: Lysander (c. 454-395 BCE), Spartan general who defeated Athens ending the Peloponnesian War.', 'Λύσανδρος', 'Lysander', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000160', 'Antiochus', 'masculine', TRUE, FALSE, 'Greek name meaning "resistant" or "holding against". From Greek *anti* (*ἀντί*) "against" + *okhos* (*ὄχος*) "holder" from *ekhein* (*ἔχειν*) "to hold". Common name among Seleucid kings, including Antiochus III the Great.', 'Ἀντίοχος', 'Antiochus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000161', 'Polybius', 'masculine', TRUE, FALSE, 'Greek name meaning "much life" or "very lively". From Greek *polys* (*πολύς*) "much, many" + *bios* (*βίος*) "life". Famous bearer: Polybius (c. 200-118 BCE), Greek historian known for *The Histories*, covering the rise of the Roman Republic.', 'Πολύβιος', 'Polybius', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000162', 'Belisarius', 'masculine', TRUE, FALSE, 'Greek name of uncertain origin, possibly from Gothic or Slavic roots. Famous bearer: Belisarius (c. 505-565 CE), Byzantine general under Emperor Justinian I, one of the greatest military commanders in history who reconquered much of the Western Roman Empire.', 'Βελισάριος', 'Belisarius', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000163', 'Theodora', 'feminine', TRUE, FALSE, 'Greek name meaning "gift of God" or "God''s gift". From Greek *theos* (*θεός*) "god" + *doron* (*δῶρον*) "gift". Famous bearer: Theodora (c. 500-548 CE), Byzantine empress, wife of Justinian I, influential in imperial policy and champion of women''s rights.', 'Θεοδώρα', 'Theodora', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000164', 'Parmenion', 'masculine', TRUE, FALSE, 'Greek name meaning "constant" or "steadfast". From Greek *parmeno* "to remain, to stand firm" or related to *para* (*παρά*) "beside" + *meno* (*μένω*) "to remain". Famous bearer: Parmenion (c. 400-330 BCE), Macedonian general, Philip II''s most experienced commander and key to Alexander''s early victories.', 'Παρμενίων', 'Parmenion', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000165', 'Hephaestion', 'masculine', TRUE, FALSE, 'Greek name meaning "of Hephaestus" or "sacred to Hephaestus". From Greek *Hephaistos* (*Ἥφαιστος*), god of fire and metalworking. Famous bearer: Hephaestion (c. 356-324 BCE), closest friend and companion of Alexander the Great, possibly his lover.', 'Ἡφαιστίων', 'Hephaestion', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

('NA000166', 'Polydorus', 'masculine', TRUE, FALSE, 'Greek name meaning "many gifts" or "much giving". From Greek *polys* (*πολύς*) "much, many" + *doron* (*δῶρον*) "gift". In Greek mythology, Polydorus was the youngest son of Priam and Hecuba, killed during the Trojan War.', 'Πολύδωρος', 'Polydorus', 'SC00002', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),

